import React from 'react';
import styled from 'styled-components'

const A = styled.a `

font-family: 'Montserrat', sans-serif;



`

function Header() {
  return (
    <header>

        <div className="logo">
            LOGO
        </div>

        <nav>
            <ul>
                <li>
                    <a href = "#">Hem</a>
                    <A>Hem</A>
                </li>
            </ul>
        </nav>





    </header>
  );
}

export default Header;
